import React from "react";

export default () => {
  return (
    <div className="link-ctn">
      <div className="main">
        <div className="color"></div>
        <div className="title">
          <h2>CSS</h2>
        </div>
      </div>
      <ul className="site-list">
        <li>
          <div className="backcolor">
            <h3>UI 参考网站 -- dribbbie</h3>
          </div>
        </li>
      </ul>
      <style jsx>{`
        .link-ctn {
          width: 80%;
          margin: 0 auto;
        }
        .main {
          padding: 10px 20px;
          background: #212329;
          border-radius: 6px;
          display: flex;
          align-items: center;
        }
        .main > .color {
          width: 66px;
          height: 40px;
          border-radius: 4px;
          margin: 0 20px;
          background: #4eac6d;
        }
        .main > .title {
          flex: 1;
          font-size: 30px;
          text-align: center;
        }
        .site-list {
          width: 80%;
          margin: 10px 0;
          margin-left: 20%;
          background: #212329;
        }
      `}</style>
    </div>
  );
};
